def AdjacencyFromPath(path):
    list = path.split('->')
    graph = {}
    for i in range(len(list)-1):
        key = list[i]
        value = list[i+1]

        if key in graph.keys():
            if value not in graph[key]:
                graph[key].append(value)
        else:
            graph[key] = [value]

    print(graph['1692'])
    print(graph['1690'])

    print(graph)

